import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (
      <div className='background'>
        <nav className='align'>    
        <u >  
            <h3>Train Route Management</h3><br/>
          <NavLink to="/routes"><b> Route Details</b></NavLink><br/><br/>
         <NavLink to="/trains"><b>Train Details </b></NavLink><br/><br/>
        <NavLink to="/station"><b>Intermediate Stations </b></NavLink><br/><br/>
          <NavLink to="/timeschedule"><b>Train Schedule</b></NavLink><br/><br/>
        </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
